DROP TABLE IF EXISTS `collect_cat`;
CREATE TABLE `collect_cat` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `category_id` int(11) NOT NULL DEFAULT '0' COMMENT '类ID',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '父类ID',
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '名称',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '类型',
  `icon` varchar(500) NOT NULL COMMENT '图标',
  `url` varchar(500) NOT NULL DEFAULT '' COMMENT '链接',
  `prop` varchar(500) NOT NULL DEFAULT '' COMMENT '属性链接',
  PRIMARY KEY (`id`),
  KEY `category_id` (`category_id`),
  KEY `parent_id` (`parent_id`),
  KEY `sort` (`sort`)
) ENGINE=MyISAM AUTO_INCREMENT=2088 DEFAULT CHARSET=utf8;

